store = {}

def get_tile_num(tile):
    tile_lines = tile.split('\n')
    return tile_lines[0].split(' ')[1]


def store_tile(tile):
    tile_lines = tile.split('\n')
    num = tile_lines[0].split(' ')[1]
    rest = tile_lines[1:]
    store[num] = rest


def rotate_tile(block, num_rotations):
    if num_rotations == 0:
        return block

    for i in range(num_rotations):
        new_block = []
        for row in reversed(range(len(block[0]))):
            new_line = []
            for aisle in range(len(block)):
                new_line.append(block[aisle][row])
            new_block.append(''.join(new_line))
        block = new_block
    return block

def flip_vertical(block):
    new_block = []
    for aisle in range(len(block)):
        new_line = []
        for row in reversed(range(len(block[aisle]))):
            new_line.append(block[aisle][row])
        new_block.append(''.join(new_line))
    return new_block


def parse_edges(tile):
    num = get_tile_num(tile)
    tile_lines = tile.split('\n')

    clockwise = [
        [c for c in tile_lines[1]],         # top
        [l[-1] for l in tile_lines[1:]],    # right
        [c for c in tile_lines[-1]],        # bottom
        [l[0] for l in tile_lines[1:]]      # left
    ]

    tile_edges[f'{num}-n-0'] = clockwise
    tile_edges[f'{num}-n-1'] = clockwise[1:] + clockwise[0]
    tile_edges[f'{num}-n-2'] = clockwise[2:] + clockwise[:2]
    tile_edges[f'{num}-n-3'] = clockwise[3:] + clockwise[:3]

    mirror_clockwise = [
        list(reversed([c for c in tile_lines[1]])),
        list(reversed([l[0] for l in tile_lines[1:]])),
        list(reversed([c for c in tile_lines[-1]])),
        list(reversed([l[-1] for l in tile_lines[1:]]))
    ]

    tile_edges[f'{num}-f-0'] = mirror_clockwise
    tile_edges[f'{num}-f-1'] = mirror_clockwise[1:] + mirror_clockwise[0]
    tile_edges[f'{num}-f-2'] = mirror_clockwise[2:] + mirror_clockwise[:2]
    tile_edges[f'{num}-f-3'] = mirror_clockwise[3:] + mirror_clockwise[:3]


def match_edges(tile, ot):
    for pos in range(len(tile_edges[tile])):
        for pos2 in range(len(tile_edges[ot])):
            if tile_edges[tile][pos] == tile_edges[ot][pos2]:
                if tile not in matches:
                    matches[tile] = {}
                if ot not in matches:
                    matches[ot] = {}
                matches[tile][pos] = (ot, pos2)
                matches[ot][pos2] = (tile, pos)

