def get_direction(tile, dir):
    down = []
    while dir in matches[tile]:
        next_tile, opdir = matches[tile][dir]
        down.append(next_tile)
        tile = next_tile
        if opdir not in opposite:
            return []
        else:
            dir = opposite[opdir]

    return down


