def count_sea_monsters(map):
    count = 0
    aisle = 0
    while aisle <= (len(map) - 3):
        x = 0
        while x <= (len(map[aisle]) - 20):
            if sea_monster_at(map, aisle, x):
                count += 1
            x += 1
        aisle += 1

    return count


